INSERT INTO `contenidos` (`id`, `contenido`, `cod`) VALUES
(9, '<p>Banco Santander Rio</p>\r\n\r\n<p>CBU: 12345678910111213</p>\r\n\r\n<p>TITULAR: PINTURERIA ARIEL</p>\r\n\r\n<p>CUIT: 12-34567891-13&nbsp;</p>\r\n', 'Cuentas bancarias'),
(10, '<h1><span style=\"font-size:20px\"><strong>COMPRAS ONLINE</strong></span></h1>\r\n\r\n<hr />\r\n<h2><span style=\"font-size:16px\"><strong>MERCADOPAGO</strong></span></h2>\r\n\r\n<p>Para pagos con tarjetas de cr&eacute;ditos tenemos hasta en 12 cuotas ofreciendo mercadopago<br />\r\nEn productos de pintura, escaleras, herramientas para pintores, herramientas manuales.</p>\r\n\r\n<p><img alt=\"\" src=\"http://192.168.0.212/pintureria ariel/assets/archivos/801a4b9.png\" style=\"height:148px; width:340px\" /></p>\r\n\r\n<p><a href=\"https://www.mercadopago.com.ar/cuotas\" target=\"_blank\">* Conoc&eacute; todas las promociones y cuotas de MercadoPago</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1><span style=\"font-size:20px\"><strong>COMPRAS TELEF&Oacute;NICAS O MOSTRADOR</strong></span></h1>\r\n\r\n<hr />\r\n<ul>\r\n	<li>Jueves a Sabado plan Ahora 12 y Ahora 18</li>\r\n	<li>Todos los dias 6 cuotas con el 10% de descuento.</li>\r\n	<li>De contado 20% de descuento.&nbsp;</li>\r\n	<li>Con tarjeta Cordobesa todos los dias hasta 20 cuotas.&nbsp;</li>\r\n	<li>Aceptamos todas las tarjetas.</li>\r\n</ul>\r\n', 'Financiación'),
(11, '', 'MÉTODOS DE ENVIÓS');
